import styled from "styled-components";

type MenuType = {
	menuItems: Array<string>;
};

export function Menu(props: MenuType) {
	return (
		<StyledMenu>
			<ul>
                ${props.menuItems }
            </ul>
		</StyledMenu>
	);
}

const StyledMenu = styled.nav``;
